import { Outlet } from "react-router-dom";
import Navbar from "../Navbar/Navbar";
import SideBar from "../Sidebar/Sidebar";
import Footer from "../";

function Static() {
  return (
    <div className="layout">
      <Navbar />
      <SideBar />
      <div className="page-content">
        <Outlet />
      </div>
      <Footer />
    </div>
  );
}

export default Static;
